import { Carousel } from "antd";
import { Fragment } from "react";

const CarouselComp = () => {
  return (
    <div id="MyCarousel">
      <style>
        {`
                #MyCarousel .img{
                    height:450px;
                    width: 100%;
                    overflow:hidden                    
                }
                #MyCarousel img{
                    width:100%;
                }
            `}
      </style>
      <Carousel autoplay>
        <div className="img">
          <img src="/images/house1.jpg" alt="house1" />
        </div>
        <div>
          <h3>2</h3>
        </div>
        <div>
          <h3>3</h3>
        </div>
        <div>
          <h3>4</h3>
        </div>
      </Carousel>
    </div>
  );
};

export default CarouselComp;
